At long last: here’s my PM #skincareroutine that I’ve created to take care of my #oilyskin, #acne, and #acnemarks.

As always, remember that this routine is tailored to *my* skin, and it may or may not produce the same results for you. Use it as a general guide, and not something to copy-paste onto your face.

I’ve been using #tretinoin for nearly 3 years now, which is why I’m able to use it at a high frequency. Also, it’s super important to note that tretinoin is a prescription drug. I started using it under my dermatologist’s prescription, and if you wish to start using it, you must consult one and discuss it with them. Do NOT start using it without medical supervision.

Since I use tret, I do not need to use any other OTC retinoids like #retinol or #adapalene, but those work great as well. Lower strength retinoids have been proven to give similar results to higher strength ones over time—the only differences are that they cause lesser irritation and take a little longer to work.

If you have any questions (whether related to this routine or otherwise), feel free to ask me in the comments! 💙

